“Nikmatilah hal-hal kecil… karena suatu hari Anda akan menengok ke belakang dan menyadari bahwa itu adalah hal besar.” (Robert Brault)

Hidup adalah kumpulan hal-hal kecil yang mungkin sering kita lupakan. Selain menyelesaikan target pekerjaan, jangan lupa luangkan waktu untuk keluarga. Bercengkrama dengan keluarga, walau mungkin hanya via video call; beraktivitas bersama seperti mendampingi anak belajar, bermain, dll. Mungkin tak semua terlihat berarti. Namun kelak resultan semua itu bisa memberikan kita keberhasilan. 

Untuk menikmati setiap momen kehidupan, cobalah bersyukurlah. Setiap hari, setiap saat. Saat kita telah mampu menjalani dan menikmati apapun rasa kehidupan dengan balutan keimanan dan kesadaran bahwa kekayaan sejati itu terletak pada hati yang bersyukur. Boleh jadi hal besar yang terjadi di kemudian hari adalah tambahan nikmat Allah akibat rasa syukur ini. “Sesungguhnya jika kamu bersyukur, pasti Kami akan menambah (nikmat) kepadamu.” (QS. Ibrahim: 7)

